const Nav = () => {
    return (
        <nav style = {{display: 'flex', 
                            background:'green', 
                            color:'whitesmoke',
                            textDecoration:'none',
                            justifyContent: 'space-around'
                            }}>
                <Link href={'/'}><a>Home</a></Link>
                <Link href={'/details'}><a>Skills Details</a></Link>
            </nav>

    )
}

export default Nav;
